-- title:  battlejam2
-- author: mantratronic / RiFT
-- desc:   2nd cart from the september 2nd 2021 jam
-- script: lua
function TIC()t=time()/100
for y=0,136 do for x=0,240 do
Y=(68-y+t)*y/1000+t
X=(120-x+t)*x/2000+t
h=math.sqrt(X^2+Y^2)//1
g=math.atan(X,Y)*10
g=g*h//4
c=(math.abs(68-y)+math.abs(120-x)+t)//20%4+12
if((g+10*math.sin(t/4+h/5))%100>50) then
if c>14 then
pix(x,y,h+(g&h)&t//1%4)
elseif c<14 and c>=13 then
pix(x,y,(x+y+t)/4%4+8)
else
pix(x,y,0)
end
else
pix(x,y,c)
end
end end 
end

--if((g+10*math.sin(t/4+h/5))%100>50) then
--if c>14 then
--pix(x,y,h+(g&h)&t//1%4)
--elseif c<14 and c>=13 then
--pix(x,y,(x+y+t)%4+8)
--else
--pix(x,y,0)
--end
--else
--pix(x,y,c)
--end
